(let [result (zipmap (vals broadcasters) (map (fn [id] (center-degree id t0 tmax :distribution)) (keys broadcasters)))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar] ]
         [:geom_boxplot]
    	 ;[:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2}]
         [:scale_y_log10]
         [:guides {:fill "none"}]
         [:xlab "Broadcaster"]
         [:ylab "Degree"]
         [:theme_bw]
         [:ggtitle "Center degree distributions"])]
      {:width 12 :height 6 }))  
